import PaginationComp from "./PaginationComp";
import Borad2Table from "./Borad2Table";

export default function Board2() {
  return (
    <>
      <div
        style={{
          width: "90%",
          height: "300px",
          backgroundColor: "#6c757d",
          margin: "0 auto",
        }}
      ></div>
      <div
        style={{
          width: "80%",
          height: "600px",
          paddingTop: "50px",
          margin: "0 auto",
        }}
      >
        <Borad2Table />
      </div>

      <PaginationComp />
    </>
  );
}
